	function popUp(item) {
		var self = item;
		self.removeClass('fadeToBottom');
		self.addClass('fadeFromBottom');
		self.css({opacity:'1'});
	}

	function hide(item) {
		var self = item;
		self.removeClass('fadeFromBottom');
		self.addClass('fadeToBottom');
		self.css({opacity:'0'});
	}

	function menuPopup() {
		var menuList = $('.main-menu ul li');

		menuList.each(function(i) {

			var self = $(this);

			setTimeout(function() {
				self.removeClass('fadeToBottom');
				self.addClass('fadeFromBottom');
				self.css({opacity:'1'});
			}, i * 100);
		});
	}

	function menuHide() {

		
		var menuList = $('.main-menu ul li');
			
		$(menuList.get().reverse()).each(function(i) {


			var self = $(this);

			setTimeout(function() {
				self.removeClass('fadeFromBottom');
				self.addClass('fadeToBottom');
				self.css({opacity:'0'});
			}, i * 100);
		});
	}



